▪️
▪️
Fue edificada en 1012 por el andalusí Geber Güeber, siendo reconstruida posteriormente en el S.XV por el concejo para la instalación del que fuera el primer reloj de la ciudad. 
▪️
▪️
A inicios del Siglo XVI el edificio pasa a tener una función de torre vigía o atalaya con la función de dar aviso de los ataques de los berberiscos a la costa de Cádiz, en esos tiempos, con frecuencia llegaban embarcaciones ligeras del norte de África para raptar gente y exigir luego un pago por su liberación. Esta torre tenía el cometido de avisar de que había moros en la costa, de allí la célebre expresión.
▪️
▪️
La torre se encuentra adosada a la Iglesia de San Dionisio. Es propiamente un edificio civil de propiedad municipal que no corresponde en origen con el resto, pero que al estar adosada al templo, y con la espadaña que se le añadió, le sirve de campanario. De hecho, está declarada como Bien de Interés Cultural con un código distinto al de la iglesia en sí.
